import React from "react";
import "./navigacija.css";

const navigacija = () => {
  return (
    <nav>
      <ul>
        <li>Naslovna</li>
        <li>Prijava</li>
        <li>Registracija</li>
      </ul>
    </nav>
  );
};

export default navigacija;
